package com.qhc.steigenberger.domain;import java.io.Serializable;/** * * */public class MenusDto implements Serializable {	private static final long serialVersionUID = 1L;	/* code */	private String code = null;	/* Name */	private String name = null;	/* childs */	private String[] childs = null;	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String[] getChilds() {		return childs;	}	public void setChilds(String[] childs) {		this.childs = childs;	}}